Determines the integer value of the system property with the specified name. The first argument is treated as the name of a system property. System properties are accessible through the System.getProperty(java.lang.String) method. The string value of this property is then interpreted as an integer value using the grammar supported by decode and an Integer object representing this value is returned. The second argument is the default value. An Integer object that represents the value of the second argument is returned if there is no property of the specified name, if the property does not have the correct numeric format, or if the specified name is empty or null. In other words, this method returns an Integer object equal to the value of: getInteger(nm, new Integer(val)) but in practice it may be implemented in a manner such as:  Integer result = getInteger(nm, null);
 return (result == null) ? new Integer(val) : result;
 to avoid the unnecessary allocation of an Integer object when the default value is not needed.
